const token = localStorage.getItem("Admin-Token");

const routes = [
  {
    type: "collapse",
    name: "Dashboard",
    key: "dashboard",
    icon: <Icon fontSize="small">dashboard</Icon>,
    route: "/dashboard",
    component: Dashboard,
  },
  {
    type: "collapse",
    name: "Users Detail",
    key: "tables",
    icon: <Icon fontSize="small">table_view</Icon>,
    route: "/tables",
    component: Tables,
  },
  {
    type: "collapse",
    name: "Notifications",
    key: "notifications",
    icon: <Icon fontSize="small">notifications</Icon>,
    route: "/notifications",
    component: Notifications,
  },
  {
    type: "collapse",
    name: "Profile",
    key: "profile",
    icon: <Icon fontSize="small">person</Icon>,
    route: "/profile",
    component: Profile,
  },
  {
    type: "collapse",
    name: "Add User",
    key: "sign-up",
    icon: <Icon fontSize="small">assignment</Icon>,
    route: "/sign-up",
    component: SignUp,
  },
];

const protectedRoutes = routes.map((route) => (
  <Route
    key={route.route}
    path={route.route}
    exact
    render={() => (token ?
      <route.component /> : {
              name: "Sign In",
              icon: <Icon fontSize="small">login</Icon>,
              route: "/authentication/sign-in",
              component: <SignIn />,
            })}
  />
));

